import React from "react";

const Grid = () => {
  return (
    <article className="grocery-item">
      <div className="btn-container">
        <button className="edit-btn">
          <FaEdit />
        </button>
        <button className="delete-btn">
          <FaTrash />
        </button>
      </div>
    </article>
  );
};

export default Grid;
